import styled from 'styled-components';

const Home = () => {
  return (
    <div>
      <h1>Hocacame</h1>
    </div>
  );
};

const Container = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    height: 100vh;
    background-color: #004643;
    color: white;
    font-size: calc(10px + 2vmin);
    text-align: center;
`;


export default Home;
